	custumize_base = dict()
	for key , value in weaponDict.items():
		final_ouput = []
		for item in value:
			# print type(item)
			
			sub_words= item.split(",")
			
			for element_List in sub_words:
				elements = element_List.split()
				t4 =""
				t5 =""
				for element in elements:
					element = element.strip()
					flag = any(char.isdigit() for char in element)
					if flag :
						t4 += element.lower()
						t5 += element.lower()
							
					else:
						t4 += element.lower()[0]
						t5 += element.lower()

					final_ouput.append(t5)
				final_ouput.append(t4)
		final_ouput.append(key.lower())
		# print final_ouput	
		custumize_base[key] = final_ouput
	return custumize_base	